@stoohey Can can confirm this?
If you need to run your application in HTTPS mode you need to change the "widget" alias to HTTPS. Otherwise IE will bring up some "Unsecure elements" warning when running under HTTPS.

Here is the snippet:
---------------------
qx.Class.define("Application",
{
  extend : qx.application.Gui,

  members :
  {
    main : function()
    {
      // Call super class
      this.base(arguments);

      // Create button
      var button1 = new qx.ui.form.Button("First Button");
      button1.setVisibility( false );
      button1.setBackgroundImage( "./button.png" );

      // Set button location
      button1.setTop(50);
      button1.setLeft(50);

      // Add button to document
      button1.addToDocument();

      // Add an event listener
      button1.addEventListener("execute", function(e) {
        alert("Hello World!");
      });
    }
  }
});
-----

Alex, the problem is still there ( "Unsecure content worning" in IE under SSL ) if you use relative urls like these with the snippet from comment #28:
1. button1.setBackgroundImage("/images/button.png");
2. button1.setBackgroundImage("button.png");
The relative url "./button.png" is OK.

With Revision #19980 both open issues should also be fixed.

